import React from 'react';
import { Grid, Table, TableBody, TableCell, TableHead, TableRow, Typography, Paper } from '@mui/material';
import { styled } from '@mui/system';


// Structure des données des groupes avec des images de drapeaux
const groupsData = [
    {
        groupName: "Groupe A",
        teams: [
            { id: 1, name: "Portugal", flag: "/images/flags/portugal.png", played: 3, goals: "7:2", points: 7 },
            { id: 2, name: "Mexique", flag: "/images/flags/mexico.png", played: 3, goals: "6:4", points: 7 },
            { id: 3, name: "Russie", flag: "/images/flags/russia.png", played: 3, goals: "3:3", points: 3 },
            { id: 4, name: "Nouvelle-Zélande", flag: "/images/flags/nz.png", played: 3, goals: "1:8", points: 0 }
        ]
    },
    {
        groupName: "Groupe B",
        teams: [
            { id: 1, name: "Allemagne", flag: "/images/flags/germany.png", played: 3, goals: "7:4", points: 7 },
            { id: 2, name: "Chili", flag: "/images/flags/chile.png", played: 3, goals: "4:2", points: 5 },
            { id: 3, name: "Australie", flag: "/images/flags/australia.png", played: 3, goals: "4:5", points: 2 },
            { id: 4, name: "Cameroun", flag: "/images/flags/cameroon.png", played: 3, goals: "2:6", points: 1 }
        ]
    }
];

// Style personnalisé pour les drapeaux et le classement
const Flag = styled('img')({
    width: '30px',
    height: '20px',
    marginRight: '10px',
    borderRadius: '2px',
});

const RankCircle = styled('div')(({ rank }) => ({
    display: 'inline-block',
    backgroundColor: '#1E88E5',  // Couleur plus vive
    color: 'white',
    borderRadius: '50%',
    width: '35px',
    height: '35px',
    textAlign: 'center',
    lineHeight: '35px',
    fontSize: '16px',
    fontWeight: 'bold',
    marginRight: '10px',
}));
import { Grow } from '@mui/material';  // Import Grow pour les animations

const GroupStage = () => {
    return (
        <Grid container spacing={4} style={{ padding: '20px' }}>
            {groupsData.map((group, index) => (
                <Grid item xs={12} md={6} key={index}>
                    <Grow in={true} timeout={1000}>
                        <Paper elevation={3} style={{ padding: '20px', backgroundColor: '#1C1C1C', color: 'white' }}>
                            <Typography variant="h5" gutterBottom style={{ marginBottom: '10px', color: '#FFFFFF', fontWeight: '600' }}>{group.groupName}</Typography>
                            <Table>
                                <TableHead>
                                    <TableRow>
                                        <TableCell style={{ color: 'white' }}>#</TableCell>
                                        <TableCell style={{ color: 'white' }}>Équipe</TableCell>
                                        <TableCell style={{ color: 'white' }} align="right">MJ</TableCell>
                                        <TableCell style={{ color: 'white' }} align="right">B</TableCell>
                                        <TableCell style={{ color: 'white' }} align="right">PTS</TableCell>
                                    </TableRow>
                                </TableHead>
                                <TableBody>
                                    {group.teams.map((team, idx) => (
                                        <TableRow key={team.id}>
                                            <TableCell>
                                                <RankCircle rank={idx + 1}>{idx + 1}</RankCircle>
                                            </TableCell>
                                            <TableCell>
                                                <Flag src={team.flag} alt={team.name} /> {team.name}
                                            </TableCell>
                                            <TableCell align="right">{team.played}</TableCell>
                                            <TableCell align="right">{team.goals}</TableCell>
                                            <TableCell align="right">{team.points}</TableCell>
                                        </TableRow>
                                    ))}
                                </TableBody>
                            </Table>
                        </Paper>
                    </Grow>
                </Grid>
            ))}
        </Grid>
    );
};

export default GroupStage;
